import React from 'react';
import { Btn, Container } from '../styles/App'
import {GlobalStyle} from ''
import MetaData from './MetaData';

function App() {
  return (
    <>
    <MetaData />
    <GlobalStyle /> 
    <Container>
      <h1>Magic Match</h1>
      <Btn>New Game</Btn>
    </Container>
    </>
  );
}

export default App
